///FAQ ਇੱਕ ਦਿਨ ਦੇ ਅੰਦਰ ਮੈਂ ਕਿੰਨਾ ਖੂਨਦਾਨ ਜਾਂ ਪ੍ਰਾਪਤ ਕਰ ਸਕਦਾ ਹਾਂ? ਉੱਤਰ ਭੋਜਨ ਪ੍ਰਾਪਤ ਕਰਨ ਜਾਂ ਦਾਨ ਕਰਨ ਦੀ ਕੋਈ ਸੀਮਾ ਨਹੀਂ ਹੈ ਕੀ ਮੈਂ ਇਸ ਐਪ ਦੀ ਵਰਤੋਂ ਕਰਕੇ ਪੈਸੇ ਦਾਨ ਕਰ ਸਕਦਾ ਹਾਂ! ਉੱਤਰ ਵਰਤਮਾਨ ਵਿੱਚ ਇਸ ਐਪ ਦੀ ਵਰਤੋਂ ਕਰਕੇ, ਤੁਸੀਂ ਪੈਸੇ ਦਾਨ ਨਹੀਂ ਕਰ ਸਕਦੇ. ਕੀ ਇਹ ਐਪ ਉਪਭੋਗਤਾ ਦੀ ਜਾਣਕਾਰੀ ਨੂੰ ਸਟੋਰ ਜਾਂ ਵੇਚਦਾ ਹੈ ਉੱਤਰ ਨਹੀਂ ਅਸੀਂ ਕਿਸੇ ਵੀ ਕਿਸਮ ਦੀ ਉਪਭੋਗਤਾ ਜਾਣਕਾਰੀ ਵੇਚ ਜਾਂ ਸਟੋਰ ਨਹੀਂ ਕਰਦੇ ਜਿਸਨੂੰ ਮੇਰਾ ਭੋਜਨ ਪ੍ਰਾਪਤ ਹੋਵੇਗਾ ਉੱਤਰ ਗੈਰ ਸਰਕਾਰੀ ਸੰਸਥਾਵਾਂ ਜਾਂ ਉਹ ਵਿਅਕਤੀ ਜਿਸ ਨੂੰ ਭੋਜਨ ਦੀ ਜ਼ਰੂਰਤ ਹੈ ਇਸ ਐਪ ਤੋਂ ਭੋਜਨ ਪ੍ਰਾਪਤ ਕਰ ਸਕਦੇ ਹਨ. ਕੀ ਜੇ ਭੋਜਨ ਚੰਗੀ ਗੁਣਵੱਤਾ ਦਾ ਨਹੀਂ ਹੈ ਉੱਤਰ ਜੇ ਭੋਜਨ ਮਾਰਕ \'ਤੇ ਨਹੀਂ ਹੈ, ਤਾਂ ਤੁਸੀਂ ਤੁਰੰਤ ਭੋਜਨ ਵਾਪਸ ਕਰ ਸਕਦੇ ਹੋ! ਸਾਡੇ ਨਾਲ ਸੰਪਰਕ ਕਰੋ
///Earn ਕੀ ਤੁਸੀਂ ਇੱਕ ਕਿਸਾਨ ਹੋ? ਕੀ ਤੁਸੀਂ ਖਰੀਦਦਾਰ ਹੋ?
ਮੈਂ ਆਪਣੀ ਫਸਲ ਨੂੰ ਕਿੰਨੀ ਕੀਮਤ ਤੇ ਵੇਚ ਸਕਦਾ ਹਾਂ? ਸਾਰੀਆਂ ਕੀਮਤਾਂ ਕਿਸਾਨਾਂ ਦੁਆਰਾ ਨਿਰਧਾਰਤ ਕੀਤੀਆਂ ਜਾਂਦੀਆਂ ਹਨ, ਫਿਰ ਵੀ ਸਭ ਤੋਂ ਘੱਟ ਮੁੱਲ ਵਾਲੇ ਕਿਸਾਨ ਵਧੇਰੇ ਧਿਆਨ ਪ੍ਰਾਪਤ ਕਰਨਗੇ. ਮੈਂ ਇਸ ਐਪ ਤੇ ਕਿਹੜੀਆਂ ਫਸਲਾਂ ਵੇਚ ਸਕਦਾ ਹਾਂ? ਤੁਸੀਂ ਵੇਚ ਸਕਦੇ ਹੋ - ਕਣਕ, ਚੌਲ, ਮੱਕੀ, ਓਟ, ਜੌ ਅਤੇ ਕੋਈ ਹੋਰ ਸਬਜ਼ੀਆਂ. ਕੀ ਇਹ ਐਪ ਪੂਰੇ ਭਾਰਤ ਵਿੱਚ ਕੰਮ ਕਰਦਾ ਹੈ? ਹਾਂ, ਪੂਰੇ ਭਾਰਤ ਵਿੱਚ ਗੁੱਡਰ ਕਾਰਜਸ਼ੀਲ ਹੈ. ਫਸਲਾਂ ਦੀ Transportੋਆ .ੁਆਈ ਲਈ ਕੌਣ ਜ਼ਿੰਮੇਵਾਰ ਹੈ ਵਰਤਮਾਨ ਵਿੱਚ, ਗੌਡਰ ਕਿਸੇ ਵੀ ਆਵਾਜਾਈ ਦਾ ਸਮਰਥਨ ਨਹੀਂ ਕਰ ਰਿਹਾ ਹੈ. ਅਸੀਂ ਸਿਰਫ ਦੋ ਧਿਰਾਂ ਵਿਚਕਾਰ ਇੱਕ ਬ੍ਰਿਜ ਵਜੋਂ ਕੰਮ ਕਰਦੇ ਹਾਂ. ਕੀ ਘੁਟਾਲੇ ਕਰਨ ਵਾਲਿਆਂ ਅਤੇ ਨਕਲੀ ਉਤਪਾਦਾਂ ਦੀ ਸੂਚੀਕਰਨ ਲਈ ਕੁਝ ਕਰਨਾ ਚੰਗਾ ਹੈ ਹਾਂ, ਸਾਡੀ ਸਹਾਇਤਾ ਟੀਮ ਮੈਨੂਅਲੀ ਤੌਰ \'ਤੇ ਸਾਰੇ ਉਤਪਾਦਾਂ ਦੀ ਸੂਚੀ ਵੇਖਦੀ ਹੈ ਅਤੇ ਜਾਅਲੀ ਸੂਚੀ ਨੂੰ ਹਟਾਉਂਦੀ ਹੈ.
ਭੁਗਤਾਨ ਵਿਧੀ ਕੀ ਹੈ? ਗੁੱਡਰ, ਕਿਸੇ ਵੀ ਭੁਗਤਾਨ ਵਿਧੀ ਦਾ ਸਮਰਥਨ ਨਹੀਂ ਕਰ ਰਿਹਾ ਹੈ. ਭੁਗਤਾਨ ਵਿਧੀ ਦੋਨੋ ਕਿਸਾਨ ਅਤੇ ਖਰੀਦਦਾਰ ਤੇ ਨਿਰਭਰ ਕਰਦੀ ਹੈ. ਕੀ ਗੁਡਰ ਜ਼ਿੰਮੇਵਾਰ ਹੈ ਜੇ ਮੈਂ ਆਪਣੀ ਫਸਲ ਨੂੰ ਪ੍ਰਾਪਤ ਨਾ ਕਰਾਂ? ਅਸੀਂ ਕਿਸਾਨੀ ਅਤੇ ਖਰੀਦਦਾਰ ਦੇ ਵਿਚਕਾਰ ਬ੍ਰਿਜ ਵਜੋਂ ਕੰਮ ਕਰਦੇ ਹਾਂ, ਸਾਰੀ ਆਵਾਜਾਈ ਪੂਰੀ ਤਰ੍ਹਾਂ ਤੁਹਾਡੇ ਤੇ ਨਿਰਭਰ ਕਰਦੀ ਹੈ.
ਕੀ ਇਹ ਐਪ ਪੂਰੇ ਭਾਰਤ ਵਿੱਚ ਕੰਮ ਕਰਦਾ ਹੈ? ਹਾਂ, ਪੂਰੇ ਭਾਰਤ ਵਿੱਚ ਗੁੱਡਰ ਕਾਰਜਸ਼ੀਲ ਹੈ. ਫਸਲਾਂ ਦੀ Transportੋਆ .ੁਆਈ ਲਈ ਕੌਣ ਜ਼ਿੰਮੇਵਾਰ ਹੈ ਵਰਤਮਾਨ ਵਿੱਚ, ਗੌਡਰ ਕਿਸੇ ਵੀ ਆਵਾਜਾਈ ਦਾ ਸਮਰਥਨ ਨਹੀਂ ਕਰ ਰਿਹਾ ਹੈ. ਅਸੀਂ ਸਿਰਫ ਦੋ ਧਿਰਾਂ ਵਿਚਕਾਰ ਇੱਕ ਬ੍ਰਿਜ ਵਜੋਂ ਕੰਮ ਕਰਦੇ ਹਾਂ. ਕੀ ਘੁਟਾਲੇ ਕਰਨ ਵਾਲਿਆਂ ਅਤੇ ਨਕਲੀ ਉਤਪਾਦਾਂ ਦੀ ਸੂਚੀਕਰਨ ਲਈ ਕੁਝ ਕਰਨਾ ਚੰਗਾ ਹੈ ਹਾਂ, ਸਾਡੀ ਸਹਾਇਤਾ ਟੀਮ ਮੈਨੂਅਲੀ ਤੌਰ \'ਤੇ ਸਾਰੇ ਉਤਪਾਦਾਂ ਦੀ ਸੂਚੀ ਵੇਖਦੀ ਹੈ ਅਤੇ ਜਾਅਲੀ ਸੂਚੀ ਨੂੰ ਹਟਾਉਂਦੀ ਹੈ.
ਮੌਸਮ ਲਵੋ ਜਾਣੋ ਸਰਬੋਤਮ ਖੇਤੀ ਲਈ ਮੌਸਮ!
ਖਰੀਦਦਾਰ ਮਦਦ? ਦਾਨ ਦਾ ਪਤਾ ਸਾਨੂੰ ਕਾਲ ਕਰੋ ਸਾਡੀ ਵੈਬਸਾਈਟ ਤੇ ਜਾਓ ਸਾਡੇ ਨਾਲ ਇੰਸਟਾਗ੍ਰਾਮ \'ਤੇ ਸੰਪਰਕ ਕਰੋ ਖੇਤੀ ਸਹਾਇਤਾ? ਕਿਸੇ ਕਾਰਨ ਲਈ ਦਾਨ ਕਰੋ ਭੋਜਨ ਦਾ ਦਾਨ ਕਰੋ ਜੋ ਪੂਰੀ ਦੁਨੀਆ ਨੂੰ ਪ੍ਰਭਾਵਿਤ ਕਰ ਰਿਹਾ ਹੈ ਨੋਟ ਤੁਸੀਂ ਸਿਰਫ ਪੈਕ ਫੂਡ ਦਾਨ ਕਰ ਸਕਦੇ ਹੋ ਭੋਜਨ (ਸਿਰਫ ਪੈਕ ਭੋਜਨ) ਮੌਜੂਦਾ ਕਾਰਨ ਦੀ ਜਾਂਚ ਕਰੋ ਗੈਰ ਸਰਕਾਰੀ ਸੰਗਠਨਾਂ ਨੂੰ ਭੋਜਨ ਦਾਨ ਕਰੋ ਕੋਈ ਮਦਦ ਚਾਹੀਦੀ ਹੈ ਜਿਆਦਾ ਜਾਣੋ ਛੁਟਕਾਰਾ ਆਪਣੇ ਬਿੰਦੂਆਂ ਨੂੰ ਇੱਥੇ ਛੁਡਾਓ
